import React from 'react';

import Table from './components/table';
import SearchPanel from './components/search-panel/search-panel'

import './App.css';

export default class App extends React.Component {

    state = {
        term: ''
    }

    render() {
        return (
            <div>
                <SearchPanel />
                <Table/>
            </div>
        );
    }
}
